import React, { Component } from 'react';
import './homepage.styles.css';
//import {Container} from 'react-bootstrap';
 

class homepage extends Component {
  
  render() {
    return (
      
      <div className="container-fluid ">
        
         <div className="bg">
         
              <h2>WELCOME TO RETAILCLICK ONLINE </h2>

                    <div className ="row ">
                    <div className= "feature-box col-lg-4 ">
                    <i className="iconH fas fa-grin-hearts "></i>
                      <h4>Tell Us What You Need</h4>
                      <p1>Our engineers develop new features using the latest technology to deliver a user-friendly, robust product. </p1>
                    </div>

                    <div className= "feature-box col-lg-4 ">
                    <i class="iconH far fa-bell"></i>

                      <h4>Reach Out Anytime</h4>
                      <p1>We provide both web and phone-based assistance. Thanks to our dedicated support, we have 99% customer retention and 100% satisfaction. Our account managers and competent support team promptly respond to requests and make sure your work never stops.</p1>
                    </div>
                    

                    <div className= "feature-box col-lg-4 ">
                    <i className="iconH fas fa-grin-hearts "></i>
                      <h4>Get Going Fast</h4>
                      <p1>RetailClick is designed to be retail-specific, GST ready, making implementation fast and smooth. Instead of offering endless customization options, our team first understands your business needs and then provides a process map.</p1>
                    </div>
                    


                   
                    </div>
          </div>
      </div>
      
    );
  }
}

export default homepage;
